import { SEARCH_MOVIE } from "./types";
import { apikey } from "../../src/ApiKey";

export const searchMovie = (text) => (dispatch) => {
  dispatch({
    type: SEARCH_MOVIE,
    payload: text,
  });
};
export const fetchMovie = (text) => (dispatch) => {
  axios.get(`http://www.omdbapi.com/?apikey=${apikey}&  `);
};
